import React, { Component } from "react";
import "./MailsDefault.css";

class Mail16 extends Component {
  state = {};
  render() {
    return (
      <div>
        <div>
          <div align="center">
            <table
              style={{ width: "375.0pt", borderCollapse: "collapse" }}
              width={500}
              cellSpacing={0}
              cellPadding={0}
              border={0}
            >
              <tbody>
                <tr>
                  <td style={{ padding: "0cm 0cm 0cm 0cm" }}>
                    <div align="center">
                      <table
                        style={{
                          width: "100.0%",
                          background: "#eee7ef",
                          borderCollapse: "collapse",
                        }}
                        width="100%"
                        cellSpacing={0}
                        cellPadding={0}
                        border={0}
                      >
                        <tbody>
                          <tr>
